    "2015-05-06T21:48:36.559435",nt"name": "grain-boundary-engineering-for-assessing-durability-and-aging-issues-with-nickel-based-sup-ca2cd",nt"isopen":
    true,nt"url": null,nt"notes": "The Grain Boundary Engineering (GBE) approach,
    successfully demonstrated in Phase I, that microstructural optimization provides
    a very significant improvement in reducing susceptibility to intergranular crack
    initiation and growth in conventional wrought Inconel 718.  rnThe principal objective
    of the Phase II research development program is to extend the applicability of the
    GBE technology from conventional wrought superalloys to more advanced powder metallurgy
    (PM) alloys, and in particular, the Low Solvus High Refractory (LSHR) developed
    by NASA.  In addition, the program also includes a limited effort to optimize the
    GBE process for application to wrought Inconel 718Plus.  rnThe phase II program
    will build upon the success of the phase I effort, and will have the following specific
    technical objectives: (1) develop and optimize GBE processing strategies for optimizing
    the bulk microstructure of an advanced PM disk alloy developed by NASA (i.e., LSHR)
    and Inconel 718Plus, (2) develop a cost-effective GBE processing strategy for locally
    optimizing the microstructure of the PM alloy (i.e., LSHR) at the near surface,
    and (3) evaluate the mechanical properties of the GBE-processed alloys and benchmark
    with properties of their conventional counterparts.",nt"license_title": "U.S.
